import logo from './logo.svg';
import { useState, useEffect } from "react";
import './App.css';

function App() {

  const [count, setCount] = useState(0);

  useEffect(() => {
    setTimeout(() => {
      setCount((count) => count + 1);
    }, 1000);
  });

  return <h1>I've rendered {count} times!</h1>;
}


export default App;
